import React from 'react';
import './button.css';


const Button = ({ width, text, onClick, width2 }) =>
    <div>
        <div id="button1comp"
            style={{ width: width }}
            onClick={onClick}>
            {text}
        </div>
        <div id="button2comp"
            style={{ width: width2 }}
            onClick={onClick}>
            {text}
        </div>
    </div>;

function ButtonClick() {
    alert("Clicked");
}

Button.defaultProps = {
    text: "Next",
    width: "150px",
    // onClick: ButtonClick
}

export default Button;
